      if (lookahead == '^') ADVANCE(74);
      if (lookahead == '_') ADVANCE(113);
      if (lookahead == '{') ADVANCE(62);
      if (lookahead == '|') ADVANCE(73);
      if (lookahead == '}') ADVANCE(63);
